import axios from "axios";

class Post {
    create(formData){
        const url = 'http://localhost:5000/api/create-post';
        const config = {
            headers: {
                'content-Type': 'multipart/form-data',
            }
        };
        return axios.post(url, formData, config);
    }

    getPost(){
        const url = 'http://localhost:5000/api/create-post';
    }

}

export default new Post();
